import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const CoolerPage: React.FC = () => {
  const navigate = useNavigate();
  const [prompt, setPrompt] = useState<string>('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (prompt) {
      navigate('/generator', { state: { productType: 'cooler', prompt } });
    }
  };

  const handleBackToSelection = () => {
    navigate('/');
  };

  return (
    <div className="bg-[#1a1a1a] min-h-screen py-12">
      <div className="container mx-auto px-4">
        <div className="mb-6">
          <button 
            onClick={handleBackToSelection}
            className="flex items-center text-white hover:text-purple-400 transition-colors"
          >
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
              <path fillRule="evenodd" d="M9.707 16.707a1 1 0 01-1.414 0l-6-6a1 1 0 010-1.414l6-6a1 1 0 011.414 1.414L5.414 9H17a1 1 0 110 2H5.414l4.293 4.293a1 1 0 010 1.414z" clipRule="evenodd" />
            </svg>
            返回選擇
          </button>
        </div>

        {/* Page Title */}
        <div className="text-center mb-12">
          <h1 className="text-4xl font-bold text-white mb-2">散熱器設計</h1>
          <p className="text-gray-400">使用 AI 輔助設計高效能與美觀的散熱解決方案</p>
        </div>

        {/* Product Showcase */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-12">
          <div>
            <img 
              src="https://www.coolermaster.com/product-assets/mcy-d4pn-pfhkn-s00_01.png" 
              alt="Cooler Master MasterLiquid" 
              className="w-full rounded-lg"
              onError={(e) => {e.currentTarget.src = "/mock-images/design1.jpg"}}
            />
          </div>
          <div className="flex flex-col justify-center">
            <h2 className="text-2xl font-bold text-white mb-3">MASTERLIQUID 240L CORE ARGB</h2>
            <p className="text-gray-300 mb-4">
              為您的CPU提供高效能散熱，同時帶來絢麗的ARGB燈效，打造兼具效能與美學的散熱解決方案。
            </p>
            <div className="flex space-x-4">
              <span className="inline-block bg-gray-800 px-3 py-1 text-sm text-white rounded-full">RGB燈效</span>
              <span className="inline-block bg-gray-800 px-3 py-1 text-sm text-white rounded-full">240mm散熱排</span>
              <span className="inline-block bg-gray-800 px-3 py-1 text-sm text-white rounded-full">低噪音設計</span>
            </div>
          </div>
        </div>

        {/* Design Form */}
        <div className="max-w-2xl mx-auto">
          <div className="cm-dark-container p-8 mb-8">
            <form onSubmit={handleSubmit} className="space-y-6">
              <div>
                <label htmlFor="prompt" className="block text-sm font-medium text-white mb-2">
                  設計描述
                </label>
                <textarea
                  id="prompt"
                  value={prompt}
                  onChange={(e) => setPrompt(e.target.value)}
                  className="w-full px-4 py-3 border border-gray-700 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-transparent bg-gray-800 text-white"
                  rows={6}
                  placeholder="請描述您想要的散熱器設計風格、特點、散熱效能需求..."
                  required
                />
              </div>

              <div className="pt-4">
                <button
                  type="submit"
                  className="w-full cm-button-primary py-3 px-6 rounded-md text-lg font-medium hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:ring-offset-2 focus:ring-offset-gray-900"
                >
                  開始生成設計
                </button>
              </div>
            </form>
          </div>

          {/* Design Tips */}
          <div className="bg-gradient-to-r from-purple-900/40 to-indigo-900/40 rounded-lg p-6">
            <h3 className="text-white text-lg font-medium mb-3">提示指南</h3>
            <ul className="text-gray-300 space-y-2 list-disc pl-5">
              <li>指定散熱器類型（風冷、水冷、AIO等）</li>
              <li>描述散熱效能需求和噪音偏好</li>
              <li>說明燈效需求（RGB、ARGB等）</li>
              <li>提及安裝空間限制和CPU型號兼容性</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CoolerPage;
